import React from 'react';
import './styles.css'; // Importing styles.css

const ScoreboardLayout = () => {
  return (
    <div className="scoreboard-layout">
      <div className="matchup-info">
        <div className="team-card">
          <div className="player-card">
            <div className="player-name">Player 1</div>
            <div className="player-score">10</div>
            <div className="opposition-info">vs Opponent</div>
          </div>
          {/* Repeat player cards for each player */}
        </div>
        {/* Repeat team cards for each team */}
      </div>
    </div>
  );
};

export default ScoreboardLayout;
